import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Pagination } from "swiper";
import styled from 'styled-components';

import "swiper/css";
import "swiper/css/pagination";

import Delivery from "../image/BR-event/banner_delivery.png"
import BM from "../image/BR-event/banner_delivery_bm.png";
import YGY from "../image/BR-event/banner_delivery_ygy.png";
import Kakao from "../image/BR-event/banner_delivery_kakao.png";
import KIA from "../image/BR-event/1670146074.png";
import BR from "../image/BR-event/1667538956.png";
import COLD from "../image/BR-event/1659436130.png";
import KT from "../image/BR-event/1643869329.png";
import Mpoint from "../image/BR-event/1667382917.png";
import Card from "../image/BR-event/1639297260.png";
import Hangul from "../image/BR-event/1570702843.png";
import CUP from "../image/BR-event/1578277305.png";
import BEST from "../image/BR-event/banner_praise_2022-1.png";



const BREvent = () => {
  return (
    <div>
      <Swiper
        spaceBetween={30}
        pagination={{
          clickable: true,
        }}
        slidesPerView={4}
        modules={[Pagination]}
        className="mySwiper"
      >
        <SwiperSlide><img src={Delivery} alt=""/></SwiperSlide>
        <SwiperSlide><img src={BM} alt=""/></SwiperSlide>
        <SwiperSlide><img src={YGY} alt=""/></SwiperSlide>
        <SwiperSlide><img src={Kakao} alt=""/></SwiperSlide>
        <SwiperSlide><img src={KIA} alt=""/></SwiperSlide>
        <SwiperSlide><img src={BR} alt=""/></SwiperSlide>
        <SwiperSlide><img src={COLD} alt=""/></SwiperSlide>
        <SwiperSlide><img src={KT} alt=""/></SwiperSlide>
        <SwiperSlide><img src={Mpoint} alt=""/></SwiperSlide>
        <SwiperSlide><img src={Card} alt=""/></SwiperSlide>
        <SwiperSlide><img src={Hangul} alt=""/></SwiperSlide>
        <SwiperSlide><img src={CUP} alt=""/></SwiperSlide>
        <SwiperSlide><img src={BEST} alt=""/></SwiperSlide>
      </Swiper>
    </div>
  );
};

export default BREvent;
